INSERT INTO `article_1` VALUES (1,1,'744763ba935bf1777c1c955db2bc16c9.png','ELEGANCE IS A DEFINING QUALITY OF ONE EAST, A PIONEERING DEVELOPMENT SETTING NEW STANDARDS IN EAST JAVA\'S FIRST CITY','ELEGANCE IS A DEFINING QUALITY OF ONE EAST, A PIONEERING DEVELOPMENT SETTING NEW STANDARDS IN EAST JAVA\'S FIRST CITY',NULL,NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 09:40:36',1),(2,2,'e1c351a1fbdddff7892794d425d49b58.png','ONE EAST<br/>MARKETING GALLERY<br/>JL. KETAJAYA INDAH<br/>BLOK S - III N<br/>SURABAYA','This upscale neighbourhood of East Surabaya is known as an elite and tranquil residential milieu and a culinary and lifestyle destination for the entire city.','bead8d97ce233dbfe25b22d33051e987.png',NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 09:50:50',1),(3,3,'540ae8c3cb916ccd2a1e7ba4b023be83.png','','Leisure and dining facilities include a cafe and restaurant, a barbeque area, a swimming pool, a fully-equipped gymnasium, and a walking and jogging track.','c8bf279abf0cee00f4e386d844fa5e5e.jpg','8f2477c8e226aacde7a402eba122e705.png',1,'2013-06-04 04:41:47',0,'2013-06-04 10:02:56',1),(4,4,'fe75adc4c07ae40a9673a25d9c70a78c.png','','This area of East Surabaya is known as a culinary destination, and ONE EAST is set to take this reputation to the next level.','d80835a55b0ff5dbff2ce8fb84386b69.png','c3321d909089f69a7e9a6fbe78605dbb.png',1,'2013-06-04 04:41:47',0,'2013-06-04 09:39:11',1),(5,5,'c7f199527bf1b0f38cc98f6e29ef3021.png','','Designed to bring a new level of lifestyle options to Surabaya, ONE EAST AVENUE will offer visitors the best in leisure, retail, dining and entertainment options, all under one roof.','0f9a0303495545d50b7aa6b40fc419ee.png','1a068eab652a28959081ad2fbda424a6.png',1,'2013-06-04 04:41:47',0,'2013-06-04 09:39:36',1),(6,6,'46e7bfcb1d3035aa8be31afae12d20a2.png','','A 30-floor tower with one-bedroom, two-bedroom and three-bedroom residences, and hosting a culinary and retail boulevard at ground level, ONE EAST will become a landmark destination in Surabaya, both a desirable home for residents and a lifestyle hub for discerning locals. Combining comfort and convenience with technological sophistication, this is an innovative development offering an experience never before seen in Surabaya.','d0393983ddacfac466547cc325019f7f.png',NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 09:39:56',1),(7,7,NULL,'','Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Nam cursus. Morbi ut mi. Nullam enim leo, egestas id, condimentum at, laoreet mattis, massa.','f1d57c8002ffc444c786554f6a34ec24.png',NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 04:41:47',0),(8,8,'4649db9292936d2a8b44ebef3717f8cc.png','','','3819748cd7d0588f6b788d206f67a852.png',NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 04:41:47',0),(9,9,NULL,'','In one sophisticated cosmopolitan location, a grouping of lifestyle choices to appeal to Surabaya`s most discerning residents: from the finest dining to the hippest boutiques and leisure venues.',NULL,'164d1a70426ba50421bbab555266221b.jpg',1,'2013-06-04 04:41:47',0,'2013-06-04 09:40:47',1),(10,10,'dd40d8529b39dfa16355fca27f177a65.png','','Comfort. Convenience. Amenities. Room to work and relax. Oakwood invented the corporate housing concept - and they`re still leading the way, with spacious, fully-furnished and serviced apartments that provide more space and flexibility than most hotels. The second tower of ONE EAST will be managed by this respected name in international hospitality.',NULL,'138b9c99a34bbac1cd63ca3dd5b33e4d.png',1,'2013-06-04 04:41:47',0,'2013-06-04 09:42:23',1),(11,11,'80d913accea614aa6c5abfa6a30a646c.png','','MNC is a trusted and respected name in Indonesia and, through MNC Land, is building on this trust to create some of the most prestigious developments in the country, working together with renowned partners and top international expertise.',NULL,'7595ee7b1dec7f4f88585a7472219fa3.png',1,'2013-06-04 04:41:47',0,'2013-06-04 09:42:48',1),(12,12,'a214c8a010fb8056c7f7eedda7e8a849.png','','Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Nam cursus. Morbi ut mi. Nullam enim leo, egestas id, condimentum at, laoreet mattis, massa.',NULL,NULL,1,'2013-06-04 04:41:47',0,'2013-06-05 19:33:34',1),(13,13,'538e6c883cb96f70e9ec84e6d1e3bf98.png','CONTACT US TO LEARN MORE ABOUT THE NEW SURABAYA LIFESTYLE','ONE EAST<br/>MARKETING GALLERY<br/>Jl. KERTAJAYA INDAH TIMUR<br/>BLOK S - III N<br/>SURABAYA<br/><br/>INFO@ONE-EAST.COM<br/>P: +62XXXXXXXXX<br/>F. +62XXXXXXXX<br/>',NULL,NULL,1,'2013-06-04 04:41:47',0,'2013-06-04 09:47:49',1);
